import React, { Component } from 'react';
import './videos.css';

class Videos extends Component {
    constructor () {
        super();
        this.state = {
            videos: []
        }
    }

    componentDidMount() {
        fetch('http://localhost:8080/api/channel')
        .then(res => res.json())
        .then(videos => this.setState({videos}, () => console.log('Videos fetched: ', videos)));
    }

    render () {
        return (
            <div className="App">
              <h2>Videos</h2>
              <iframe src="" width="540" height="450" style="border-style: solid"></iframe>
              <ul>
                {this.state.items.map(item => 
                    //<li key={id.videoId}>{snippet.title}</li>
                    console.log(this.state)
                )}
              </ul>
            </div>
        );
    }
}

export default Videos;
